import React, { Fragment } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from "./layout/Navbar";
import Landing from "./layout/Landing";
import './App.css';

const App = () => (
  <Router>
    <Fragment>
      <Navbar />
      <Route exact path='/' Component={Landing} />
    </Fragment>
  </Router>
);

export default App;
